return ['domain'=>NULL,'plural-forms'=>'nplurals=3; plural=(n%10==1 && (n%100<11 || n%100>19) ? 0 : n%10>=2 && n%10<=9 && (n%100<11 || n%100>19) ? 1 : 2);','language'=>'lt_LT','pot-creation-date'=>'2025-09-04 10:00-0500','po-revision-date'=>'2025-09-04 10:00-0500','translation-revision-date'=>'2025-09-04 10:00-0500','project-id-version'=>'ICS Calendar','x-generator'=>'Poedit 3.7','messages'=>['%1$sYou are running ICS Calendar in a WordPress Playground implementation.%2$s Because ICS Calendar is intended to run on a web server, some features may be unavailable or may not function properly.'=>'%1$sJūs naudojate ICS kalendorių "WordPress Playground" diegimo sistemoje.%2$s Kadangi ICS kalendorius skirtas paleisti žiniatinklio serveryje, kai kurios funkcijos gali būti neprieinamos arba veikti netinkamai.','%1$sYour site is currently using a UTC offset-based timezone setting.%2$s This can produce time display errors in the %3$s plugin in locations that observe Daylight Saving Time. Please %4$schange your timezone setting%5$s to the city nearest your location, in the same timezone, for proper time display. See our %6$sdocumentation%7$s for additional information on this issue.'=>'%1$sJūsų svetainėje šiuo metu naudojamas UTC laiko juostos nustatymas pagal UTC poslinkį.%2$s Tai gali sukelti laiko rodymo klaidų %3$s įskiepyje tose vietose, kuriose laikomasi vasaros laiko. Kad laikas būtų rodomas tinkamai, pakeiskite %4$slaiko juostos nustatymą %5$sį artimiausią jūsų vietovės miestą toje pačioje laiko juostoje. Daugiau informacijos apie šią problemą rasite %6$sdokumentuose%7$s.','Utilities'=>'Įrankiai','Settings'=>'Nustatymai','User Guide'=>'Naudotojo žinynas','Support'=>'Palaikymas','Upgrade to PRO!'=>'Atnaujinkite į PRO!','Show/hide all'=>'Rodyti / slėpti viską','ICS file could not be retrieved or was empty. Please verify URL is correct, and check your php.ini configuration to verify either cURL or allow_url_fopen is available. If you are using spaces to delimit multiple URLs, you may also wish to try using the pipe character instead. Affected URL:'=>'Nepavyko nuskaityti ICS failo arba jis buvo tuščias. Prašome patikrinti URL yra teisingas, ir patikrinkite savo php.ini konfigūraciją, kad patikrintumėte, ar yra CURL arba allow_url_fopen. Jei naudojate tarpus keliems URL atskirti, taip pat galite pabandyti naudoti vamzdžio simbolį. Paveiktas URL:','Hide past events'=>'Slėpti ankstesnius įvykius','Show past events'=>'Rodyti ankstesnius įvykius','Contact:'=>'Susisiekite su:','Resources:'=>'Ištekliai:','Click for more...'=>'Spustelėkite, jei norite gauti daugiau...','Save to your calendar'=>'Įrašyti į kalendorių','Cancelled'=>'Atšaukta','The legacy parser option is deprecated and will be removed in a future update.'=>'Senoji parserio parinktis yra nebenaudojama ir bus pašalinta būsimame atnaujinime.','The "currentweek" shortcode attribute is deprecated. Please use view="week" in your shortcode instead.'=>'"Currentweek" trumpojo kodo atributas yra pasenęs. Vietoj to trumpajame kode naudokite view="week".','The "legendinline" shortcode attribute is deprecated. Please use legendstyle="inline" in your shortcode instead.'=>'Trumpojo kodo atributas "legendinline" nebenaudojamas. Vietoj jo trumpajame kode naudokite legendstyle="inline".','Cleared %1$s %2$s transient(s).'=>'Išvalytas (-os) %1$s %2$s pereinamasis (-iai) reiškinys (-iai).','No %1$s transients were found.'=>'Nebuvo rasta jokių %1$s pereinamųjų procesų.','Your feed URL appears to contain HTTP Basic Authentication credentials. Try turning off the %1$s option under the %2$s tab above.'=>'Atrodo, kad jūsų kanalo URL yra HTTP pagrindinio autentiškumo patvirtinimo įgaliojimai. Pabandykite išjungti %1$s parinktį %2$s kortelėje aukščiau.','Use legacy feed request method'=>'Naudokite senąjį pašarų užklausos metodą','%1$sThis URL points to a file in your Media Library.%2$s While you should be able to use this URL in an %3$s shortcode, it will be a static snapshot of the calendar at the time the file was created, and will not reflect any future updates to the source calendar. Please see our %4$sUser Guide%5$s for instructions on obtaining your correct dynamic feed URL.'=>'%1$sŠis URL nurodo į failą, esantį jūsų medijos bibliotekoje %2$s Nors turėtumėte galėti naudoti šį URL %3$s trumpajame kode, tai bus statinis kalendoriaus momentinis vaizdas tuo metu, kai failas buvo sukurtas, ir neatspindės jokių būsimų šaltinio kalendoriaus atnaujinimų. Instrukcijų, kaip gauti teisingą dinaminio kanalo URL, rasite mūsų %4$s naudotojo vadove %5$s.','Error: Could not resolve IP address for %1$s.'=>'Klaida: Klaida: Nepavyko nustatyti IP adreso %1$s.','Resolved IP address for %1$s:'=>'Išspręstas IP adresas %1$s:','The text entered in the "Default shortcode" field is not a valid shortcode, and was not saved.'=>'Tekstas, įvestas lauke "Numatytasis trumpasis kodas", nėra galiojantis trumpasis kodas ir nebuvo išsaugotas.','%1$sSettings updated.%2$s You may need to refresh the page to see some changes.'=>'%1$sAtnaujinti nustatymai.%2$s Gali prireikti atnaujinti puslapį, kad pamatytumėte kai kuriuos pakeitimus.','calendar event'=>'kalendoriaus įvykis','The legacy feed request method is deprecated, and will be removed in an update in the near future. Please test your feeds with the legacy feed request method turned off.'=>'Senasis užklausos metodas yra atgyvenęs ir artimiausiu metu bus pašalintas atnaujinant. Išbandykite savo kanalus, išjungę senąjį kanalo užklausos metodą.','Map'=>'Žemėlapis','Recurring event'=>'Pasikartojantis įvykis','Recurs every %1$s years'=>'Pasikartoja kas %1$s metų','Recurs yearly'=>'Kartojasi kasmet','Recurs every %1$s months'=>'Pasikartoja kas %1$s mėnesių','Recurs monthly'=>'Kartojasi kas mėnesį','Recurs every %1$s weeks'=>'Pasikartoja kas %1$s savaičių','Recurs weekly'=>'Kartojasi kas savaitę','Recurs every %1$s days'=>'Pasikartoja kas %1$s dienų','Recurs daily'=>'Kartojasi kasdien','The "url" property in your %1$s shortcode appears to contain HTML tags; most likely your URL has been turned into a clickable link. Your calendar may not display properly as a result. Please remove the clickable link in the shortcode.'=>'Panašu, kad jūsų %1$s trumpojo kodo savybėje "url" yra HTML žymės; greičiausiai jūsų URL adresas buvo paverstas nuoroda, kurią galima spustelėti. Dėl to jūsų kalendorius gali būti rodomas netinkamai. Pašalinkite trumpojo kodo paspaudžiamą nuorodą.','The r34ics_url_get_contents() function is no longer supported.'=>'Funkcija r34ics_url_get_contents() nebepalaikoma.','%1$sPlease note:%2$s %3$s version 10.6 changes the default options for several shortcode settings. In order to maintain consistency, these new defaults are %4$snot%5$s enabled when upgrading from an earlier version. If you would like to learn more about the changes please read our %6$sblog post%7$s, or to switch to the new defaults, turn on the %8$s option on the %9$s settings%10$s page.'=>'%1$sAtkreipkite dėmesį: %2$s %3$s 10.6 versija keičia numatytuosius kelių trumpųjų kodų nustatymų parametrus. Siekiant išlaikyti nuoseklumą, šie nauji numatytieji nustatymai %4$sneįjungiami %5$s, kai atnaujinama iš ankstesnės versijos. Jei norite sužinoti daugiau apie pakeitimus, perskaitykite mūsų %6$stinklaraščio %7$s įrašą arba norėdami pereiti prie naujų numatytųjų nustatymų, įjunkite %8$s parinktį %9$s nustatymų %10$s puslapyje.','Use new parameter defaults (v.10.6)'=>'Naudoti naujus numatytus parametrus (v.10.6)','%1$sPlease note:%2$s %3$s version 11.0 streamlines the way ICS feed URLs are retrieved. This change uses a standard built-in WordPress function, so it should be fully compatible with all existing installations. If you encounter any new issues after upgrading to version 11 or later, please visit the %4$sWordPress Support Forums%5$s for assistance.'=>'%1$sAtkreipkite dėmesį: %2$s %3$s 11.0 versijoje supaprastintas ICS kanalų URL adresų gavimo būdas. Šiame pakeitime naudojama standartinė integruota "WordPress" funkcija, todėl ji turėtų būti visiškai suderinama su visais esamais įrenginiais. Jei atnaujinę 11 ar vėlesnę versiją susidursite su naujomis problemomis, pagalbos kreipkitės į %4$sWordPress palaikymo forumus%5$s.','%1$sPlease note:%2$s %3$s version 11.5.14.2 introduces a new, more secure method for handling calendar parameters when loading via AJAX. Please clear any caching plugins you are using, to ensure that your calendars are loading properly with the new method.'=>'%1$sAtkreipkite dėmesį: %2$s %3$s 11.5.14.2 versijoje įdiegtas naujas, saugesnis kalendoriaus parametrų tvarkymo būdas, kai įkeliama per AJAX. Išvalykite visus naudojamus spartinančiosios atminties įskiepius, kad kalendoriai būtų tinkamai įkeliami naujuoju metodu.','Add %1$s'=>'Pridėti %1$s','Close'=>'Uždaryti','ICS Feed URL:'=>'ICS kanalo URL:','Be sure you are using a %1$ssubscribe%2$s URL, not a %3$sweb view%4$s URL.%5$s (Entering the URL directly in your web browser should download an %6$s file.)'=>'Įsitikinkite, kad naudojate %1$sprenumeratos%2$s URL, o ne %3$sžiniatinklio peržiūros%4$s URL%5$s (Įvedę URL tiesiogiai į žiniatinklio naršyklę, turėtumėte atsisiųsti %6$s failą.)','Calendar Title:'=>'Kalendoriaus pavadinimas:','Leave empty to use calendar&rsquo;s default title. Enter %1$s to omit title altogether.'=>'Palikite tuščią, jei norite naudoti numatytąjį kalendoriaus pavadinimą. Įveskite %1$s, jei norite visiškai praleisti pavadinimą.','Calendar Description:'=>'Kalendoriaus aprašymas:','Leave empty to use calendar&rsquo;s default description. Enter %1$s to omit description altogether.'=>'Palikite tuščią, jei norite naudoti numatytąjį kalendoriaus aprašymą. Įveskite %1$s, jei norite visiškai praleisti aprašymą.','View:'=>'Peržiūrėti:','month'=>'mėnesį','list'=>'sąrašas','week'=>'savaitė','Count:'=>'Kiekis:','Format:'=>'Formatas:','Leave %1$s blank to include all upcoming events. %2$s must be a standard %3$sPHP date format string%4$s.'=>'Palikite %1$s tuščią, jei norite įtraukti visus būsimus įvykius. %2$s turi būti standartinė %3$sPHP datos formato eilutė %4$s.','Show event descriptions %1$s(change to a number in inserted shortcode to set word limit)%2$s'=>'Rodyti įvykių aprašymus %1$s(pakeiskite į skaičių įterptame trumpajame kode, kad nustatytumėte žodžių limitą) %2$s','Show event locations %1$s(if available)%2$s'=>'Rodyti įvykio vietas %1$s(jei yra)%2$s','Show event organizers %1$s(if available)%2$s'=>'Rodyti įvykio organizatorius %1$s(jei yra)%2$s','%1$sNote:%2$s Additional %3$sdisplay options%4$s are available by manually editing the shortcode after insertion.'=>'%1$sPastaba: %2$s Papildomos %3$srodymo parinktys %4$s galimos rankiniu būdu redaguojant trumpąjį kodą po įterpimo.','Insert %1$s'=>'Įterpti %1$s','Do even more with %1$s!'=>'Su %1$s padarykite dar daugiau!','Calendar Builder'=>'Kalendoriaus daryklė','Configure all calendar settings with an easy visual interface... no need to manually type shortcodes.'=>'Sukonfigūruokite visus kalendoriaus nustatymus naudodami paprastą vaizdinę sąsają... nereikia rankiniu būdu įvesti trumpųjų kodų.','Additional Views and Enhanced Features'=>'Papildomi vaizdai ir patobulintos funkcijos','New ways to display your calendar including Full, Up Next, Masonry, Month with Sidebar, Widget, and more. Additional capabilities are added to the core Month, Basic, List and Week views.'=>'Nauji kalendoriaus rodymo būdai, įskaitant "Pilnas", "Iki kito", "Masonry", "Mėnuo su šonine juosta", "Widget" ir kt. Pagrindiniai mėnesio, pagrindinio, sąrašo ir savaitės rodiniai papildyti papildomomis galimybėmis.','Customizer'=>'Pritaikymo programa','Easily modify your calendar color palettes, fonts, and more, site-wide.'=>'Lengvai keiskite kalendoriaus spalvų paletes, šriftus ir kt.','ICS Events'=>'ICS renginiai','%1$sNew!%2$s Turns %3$s into a full calendar system. Create and manage events directly in WordPress and even integrate them seamlessly with your existing feeds.'=>'%1$sNauja!%2$s Pakeičia %3$s į visą kalendoriaus sistemą. Kurkite ir tvarkykite įvykius tiesiogiai "WordPress" ir net sklandžiai integruokite juos į esamus kanalus.','Visit %1$s to learn more.'=>'Apsilankykite %1$s ir sužinokite daugiau.','Go PRO!'=>'Eiti PRO!','Getting Started'=>'Pradėkime','System Report'=>'Sistemos ataskaita','Save Changes'=>'Išsaugoti pakeitimus','Thank you for installing %1$s. Before creating your first calendar shortcode, please visit your %2$sGeneral Settings%3$s page and verify that your site language, timezone and date/time format settings are correct. See our %4$sUser Guide%5$s for more information.'=>'Dėkojame, kad įdiegėte %1$s. Prieš kurdami pirmąjį kalendoriaus trumpąjį kodą, apsilankykite savo %2$sBendrieji nustatymai%3$s puslapyje ir patikrinkite, ar jūsų svetainės kalbos, laiko juostos ir datos/laiko formato nustatymai yra teisingi. Daugiau informacijos rasite mūsų %4$sVartotojo vadove%5$s.','Quick Start Guide'=>'Greito pasirengimo darbui vadovas','An extensive %1$sUser Guide%2$s is available on our website. Below are some quick links to key resources in the documentation.'=>'Išsamų %1$sVartotojo vadovą%2$s galite rasti mūsų svetainėje. Toliau pateikiamos kelios trumpos nuorodos į pagrindinius dokumentuose esančius šaltinius.','General:'=>'Bendros:','General WordPress Settings'=>'Bendrieji "WordPress" nustatymai','%1$s Settings'=>'%1$s Nustatymai','Working with Shortcodes:'=>'Darbas su trumpaisiais kodais:','Shortcode Overview'=>'Trumpojo kodo apžvalga','Shortcode Builder'=>'Trumpųjų kodų kūrėjas','Shortcode Parameters Reference'=>'Trumpojo kodo parametrų nuoroda','Advanced Topics:'=>'Išplėstinės temos:','FAQs and Tips'=>'DUK ir patarimai','CSS Guide'=>'CSS vadovas','Developer Resources'=>'Kūrėjų ištekliai','GDPR'=>'BDAR','Appearance'=>'Išvaizda','Match calendar color palette to current Block Theme colors'=>'Suderinti kalendoriaus spalvų paletę su dabartinėmis bloko temos spalvomis','beta'=>'beta','Replaces the %1$s default neutral color palette with nearest matches from the current Site Editor Styles color palette or the %2$s file in your theme. Color selections are algorithmic, and some combinations may not pass accessibility contrast tests. This setting has no effect if you are using a "classic" theme that does not include a %3$s file.'=>'Pakeičia numatytąją %1$s neutralių spalvų paletę artimiausiomis spalvomis iš dabartinės svetainės redaktoriaus stilių spalvų paletės arba %2$s failo jūsų temoje. Spalvų parinkimas yra algoritminis, todėl kai kurie deriniai gali neatitikti prieinamumo kontrasto testų. Šis nustatymas neturi poveikio, jei naudojate "klasikinę" temą, kurioje nėra %3$s failo.','%1$sThis is currently a beta feature.%2$s It may require making some adjustments to your calendar settings or CSS for optimal display, especially if you have color-coded your feeds. Functionality is subject to change.'=>'%1$sŠiuo metu tai yra beta versija.%2$s Gali prireikti šiek tiek pakoreguoti kalendoriaus nustatymus arba CSS, kad jie būtų rodomi optimaliai, ypač jei turite spalvotus kanalus. Funkcionalumas gali keistis.','Dark mode'=>'Tamsusis režimas','Inverts color palette (light colors on a dark background). %1$sNote:%2$s Dark mode also automatically applies style changes similar to the %3$s and %4$s shortcode parameters, so you do not need to include them in your shortcode.'=>'Invertuoja spalvų paletę (šviesios spalvos tamsiame fone). %1$sPastaba: %2$s Tamsiuoju režimu taip pat automatiškai taikomi stiliaus pakeitimai, panašūs į %3$s ir %4$s trumpojo kodo parametrus, todėl jų nereikia įtraukti į savo trumpąjį kodą.','Loading'=>'Kraunasi','Always use AJAX to render calendars (recommended)'=>'Kalendoriams atvaizduoti visada naudokite AJAX (rekomenduojama)','When checked, all calendars will render via AJAX (asynchronously after the page loads). This is especially useful in conjunction with other caching plugins, or if your calendars contain a large number of events. Normally, calendar data is sent directly in the HTML of the initial page load unless AJAX has been specified in the shortcode.'=>'Jei pažymėta, visi kalendoriai bus atvaizduojami per AJAX (asinchroniškai po puslapio įkėlimo). Tai ypač naudinga kartu su kitais spartinimo įskiepiais arba jei jūsų kalendoriuose yra daug įvykių. Paprastai kalendoriaus duomenys siunčiami tiesiai į pradinio puslapio įkėlimo HTML, nebent trumpajame kode nurodytas AJAX.','Increase memory limit when rendering calendars'=>'Padidinti atminties limitą atvaizduojant kalendorius','If your calendar is failing to load with an "out of memory" fatal error, try increasing the memory limit. A minimum of 512 MB is recommended. %1$s Notes: 1) Some hosting providers may not allow applications to override the server default setting. 2) It is not possible to set this option lower than the current default memory limit on your server.'=>'Jei kalendoriaus nepavyksta įkelti su lemtinga klaida "trūksta atminties", pabandykite padidinti atminties limitą. Rekomenduojama skirti ne mažiau kaip 512 MB. %1$s Pastabos: kai kurie prieglobos paslaugų teikėjai gali neleisti programoms pakeisti numatytojo serverio nustatymo. 2) Šios parinkties negalima nustatyti mažesnės nei dabartinė numatytoji atminties riba jūsų serveryje.','deprecated'=>'nebenaudojama','If your site has stopped retrieving feeds after the version 11 update, turn on this option to use the legacy request method. This feature is deprecated and will be removed in an update in the near future.'=>'Jei po 11 versijos atnaujinimo jūsų svetainė nustojo gauti kanalus, įjunkite šią parinktį, kad galėtumėte naudoti senąjį užklausos metodą. Ši funkcija nebenaudojama ir artimiausiu metu bus pašalinta atnaujinant.','Default shortcode'=>'Numatytasis trumpasis kodas','If your site will include a large number of similarly configured calendar shortcodes, you can enter a default "base" shortcode here with the parameters that should be the same for all of the calendars. Individual shortcodes on the site can then include only the parameters that are unique to that calendar, as such: %1$s Any parameters included in the individual shortcode will override what is set here.'=>'Jei jūsų svetainėje bus daug panašiai sukonfigūruotų kalendoriaus trumpųjų kodų, čia galite įvesti numatytąjį "bazinį" trumpąjį kodą, kurio parametrai turėtų būti vienodi visiems kalendoriams. Tada į atskirus svetainės trumpuosius kodus galima įtraukti tik tuos parametrus, kurie yra unikalūs tam kalendoriui: %1$s Bet kokie parametrai, įtraukti į atskirą trumpąjį kodą, panaikins čia nustatytus parametrus.','Allow access to these hostnames that resolve to reserved IP addresses'=>'Leisti prieigą prie šių prievadinių vardų, kurie atitinka rezervuotus IP adresus','If your calendar server is hosted on the same physical server as your website, is part of the same local network, or otherwise uses a %1$sreserved IP address%2$s, enter its hostname here to allow access. For multiple calendar servers, enter one hostname per line. See %3$sthe %4$s documentation%5$s for more information.'=>'Jei kalendoriaus serveris yra tame pačiame fiziniame serveryje kaip ir jūsų svetainė, priklauso tam pačiam vietiniam tinklui arba kitaip naudoja %1$srezervuotą IP adresą%2$s, čia įveskite jo pagrindinį vardą, kad būtų leidžiama prieiga. Jei tai keli kalendorių serveriai, vienoje eilutėje įveskite po vieną prieglobsčio vardą. Daugiau informacijos rasite %3$sdokumentuose %4$s %5$s.','Enter one hostname per line. Hostnames are the base domain name, not a full URL. %1$s For example, you would enter %2$s, not %3$s.'=>'Vienoje eilutėje įveskite vieną kompiuterio vardą. Prieglobos vardai yra bazinis domeno vardas, o ne visas URL adresas. %1$s Pavyzdžiui, įveskite %2$s, o ne %3$s.','Caching'=>'Kaupimas','Transient (cache) expiration'=>'Laikinas (talpyklos) galiojimo laikas','seconds'=>'sekundės','Sets how long calendar feed data should be cached on the server (WordPress transients) before reloading. Default is 3600 (1 hour).'=>'Nustato, kiek laiko kalendoriaus kanalo duomenys turėtų būti talpinami serveryje ("WordPress" pereinamieji laikotarpiai) prieš pakartotinį įkėlimą. Numatytoji reikšmė yra 3600 (1 valanda).','Miscellaneous'=>'Įvairūs','Remove "Add ICS Calendar" button in Classic Editor'=>'Pašalinti mygtuką "Pridėti ICS kalendorių" klasikiniame redaktoriuje','By default, ICS Calendar adds an "Add ICS Calendar" button to the toolbar above the WYSIWYG editor when using Classic Editor. Check this box to remove the button. Has no effect on sites using the Block Editor (Gutenberg).'=>'Pagal numatytuosius nustatymus, naudojant klasikinį redaktorių, į įrankių juostą, esančią virš WYSIWYG redaktoriaus, įtraukiamas mygtukas "Pridėti ICS kalendorių". Pažymėkite šį langelį, kad pašalintumėte mygtuką. Neturi poveikio svetainėms, kuriose naudojamas blokų redaktorius (Gutenberg).','%1$s version 10.6 introduced new default values for several shortcode parameters. New installations automatically use the new default values, but upgraded installations will continue to use the old default values, unless this box is checked. Read more about these changes on %2$sour blog%3$s.'=>'%1$s 10.6 versijoje įvestos naujos numatytoji kelių trumpojo kodo parametrų reikšmės. Naujai įdiegtose programose automatiškai naudojamos naujos numatytosios reikšmės, tačiau atnaujintose programose ir toliau bus naudojamos senosios numatytosios reikšmės, nebent būtų pažymėtas šis langelis. Daugiau apie šiuos pakeitimus skaitykite %2$s mūsų tinklaraštyje %3$s.','Our complete user guide is available with full translation into dozens of languages on our website:'=>'Visą mūsų naudotojo vadovą su visais vertimais į dešimtis kalbų galite rasti mūsų svetainėje:','For assistance, please use our %1$ssupport request form%2$s.'=>'Jei norite gauti pagalbą, naudokitės mūsų %1$sparamos užklausos forma%2$s.','When contacting support, please include the %1$sSystem Report%2$s from this page.'=>'Kreipdamiesi į palaikymo tarnybą nurodykite %1$sSistemos ataskaita%2$s iš šio puslapio.','Spread the word!'=>'Skleiskite šią žinią!','If you find %1$s useful, you can help support our continued growth and development with a %2$sfive-star review%3$s. Thank you!'=>'Jei jums %1$s yra naudinga, galite padėti paremti mūsų nuolatinį augimą ir plėtrą, parašydami %2$s penkių žvaigždučių apžvalgą%3$s. Ačiū!','%1$s Data Cache'=>'%1$s Duomenų talpykla','Clear Cached Calendar Data'=>'Valyti talpykloje laikomos talpyklos kalendoriaus duomenis','This will immediately clear all existing cached calendar data (purge transients), forcing WordPress to reload all calendars the next time they are viewed. Caching will then resume as before.'=>'Tai iš karto išvalys visus esamus talpyklinius kalendoriaus duomenis (išvalys laikinus duomenis), priversdami "WordPress" iš naujo įkelti visus kalendorius kitą kartą, kai jie bus peržiūrėti. Kaupimas talpykloje bus tęsiamas kaip anksčiau.','ICS Feed URL Tester'=>'ICS informacijos santraukos URL testeris','If you are concerned that the plugin is not properly retrieving your feed, you can test the URL here.'=>'Jei nerimaujate, kad papildinys netinkamai nuskaito jūsų informacijos santrauką, galite patikrinti URL čia. Neapdoroti duomenys, gauti įskiepio, bus rodomi žemiau.','Enter feed URL...'=>'Įveskite informacijos santraukos URL...','Test URL'=>'Bandomasis URL','Results:'=>'Rezultatai:','%1$s received.'=>'%1$s gauta.','This appears to be a valid ICS feed URL.'=>'Atrodo, kad tai yra galiojantis ICS kanalo URL.','This does not appear to be a valid ICS feed URL.'=>'Atrodo, kad tai nėra galiojantis ICS kanalo URL.','Could not retrieve data from the requested URL.'=>'Nepavyko nuskaityti duomenų iš pareikalauto URL.','An unknown error occurred while attempting to retrieve the requested URL.'=>'Bandant nuskaityti pareikalautą URL įvyko nežinoma klaida.','Please copy the following text and include it in your message when emailing support.'=>'Nukopijuokite šį tekstą ir įtraukite jį į savo pranešimą, kai siunčiate palaikymą el. paštu.','Also please include the %1$s shortcode exactly as you have it entered on the affected page.'=>'Taip pat prašome įtraukti %1$s trumpąjį kodą tiksliai taip, kaip jį įvedėte paveiktame puslapyje.','For your site security please do NOT post the System Report in the support forums.'=>'Kad užtikrintumėte svetainės saugumą, NESKELBKITE sistemos ataskaitos palaikymo forumuose.','No events found.'=>'Įvykių nerasta.','Previous Page'=>'Ankstesnis puslapis','Next Page'=>'Kitas puslapis','All Day'=>'Visą Dieną','Today'=>'Šiandien','No events.'=>'Nėra įvykių.','No additional events this month.'=>'Jokių papildomų renginių šį mėnesį.','Last week'=>'Paskutinė savaitė','This week'=>'Šią savaitę','Next week'=>'Kita savaitę','ICS Calendar'=>'ICS Calendar','https://icscalendar.com'=>'https://icscalendar.com','Turn your Google Calendar, Microsoft Office 365 or Apple iCloud Calendar into a seamlessly integrated, auto-updating, zero-maintenance WordPress experience.'=>'Paverskite savo "Google" kalendorių, "Microsoft Office 365" ar "Apple iCloud" kalendorių sklandžiai integruotu, automatiškai atnaujinamu ir nereikalaujančiu jokios "WordPress" priežiūros.','Room 34 Creative Services, LLC'=>'Room 34 Creative Services, LLC']];
